# configuration for linkerd-lab/booksapp

upstream linkerd-lab-booksapp-booksapp.linkerd.local-webapp-7000 {
	random two least_conn;
	
	server 192.168.230.198:7000 max_fails=1 fail_timeout=10s;
	server 192.168.230.251:7000 max_fails=1 fail_timeout=10s;
	server 192.168.230.252:7000 max_fails=1 fail_timeout=10s;
	
}


server {
	
	
	listen 80;
	
	
	listen 443 ssl;
	ssl_certificate /etc/nginx/secrets/linkerd-lab-booksapp-keys;
	ssl_certificate_key /etc/nginx/secrets/linkerd-lab-booksapp-keys;
	
	
	
	
	

	server_tokens on;

	server_name booksapp.linkerd.local;

	
	

	
	
	if ($scheme = http) {
		return 301 https://$host:443$request_uri;
	}
	

	
	location / {
		
		
		proxy_http_version 1.1;
		

		proxy_connect_timeout 60s;
		proxy_read_timeout 60s;
		client_max_body_size 1m;
		proxy_set_header Host $host;
		proxy_set_header X-Real-IP $remote_addr;
		proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
		proxy_set_header X-Forwarded-Host $host;
		proxy_se

t_header X-Forwarded-Port $server_port;
		proxy_set_header X-Forwarded-Proto $scheme;
		proxy_buffering on;
		
		proxy_pass http://linkerd-lab-booksapp-booksapp.linkerd.local-webapp-7000;
		
		
	}
	
	
}
